import Box from './Box';

function Portfolio() {
    return(
        <div id="services">
            <div className='s-heading'>
                <h1>Portfolio</h1>
                <p>You can browse the sites I have made for businesses and individuals.</p>
            </div>
            <div className='b-container'>
                <Box image="https://cdn.discordapp.com/attachments/784189691321778177/844103149450821642/20210518_094419.jpg" link="www.osman-hakan.com" alte="osmanhakan" button="ALLAH"/>
                <Box image="https://cdn.discordapp.com/attachments/784189691321778177/844103149450821642/20210518_094419.jpg" link="www.osman-hakan.com" alte="osmanhakan" button="ALLAH"/>
                <Box image="https://cdn.discordapp.com/attachments/784189691321778177/844103149450821642/20210518_094419.jpg" link="www.osman-hakan.com" alte="osmanhakan" button="ALLAH"/>


            </div>
        </div>
    )
}

export default Portfolio;
